//SPDX-License-Identifier: MIT
pragma solidity ^0.8.12;

import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";
import "./GalNFT.sol";
import "./IFactory.sol";

contract GalileoFactory is IFACTORY, AccessControlUpgradeable {
    uint256 public totalCount;
    bytes32 public constant DEPLOYER_ROLE = keccak256("DEPLOYER_ROLE");
    bytes32 public constant ASSING_ROLE = keccak256("ASSING_ROLE");
    mapping(string => SerialStruct) public serials;
    mapping(string => bool) initialsExist;
    string[] initialsList;
    // IFACTORY fac;
    event GalileoProtocolDeployed(address _mintingContract);
     event minted (string text,address cny, uint256 tokenid);

    struct SerialStruct {
        address contractAddress;
        uint256 tokenId;
    }
     function addInitial(string memory initial) internal {
        require(!initialsExist[initial], "Initial already exists");
        initialsExist[initial] = true;
        initialsList.push(initial);
    }

    function getInitialsList() external view override returns (string[] memory) {
        return initialsList;
    }


    function updateSerialMap(
        string memory serial,
        address addresses,
        uint256 id
    ) external virtual override  {
        emit minted(serial,addresses,id);
        serials[serial] = SerialStruct(addresses, id);
        totalCount++;
    }
  
    GalNFT[] public nftContractAddress;

    function __GalileoFactory_init() external initializer {
        __AccessControl_init();
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(DEPLOYER_ROLE, msg.sender);
    }

    function deployMintingContract(
        string memory name,
        string memory symbol,
        uint256 fee,
        address admin,
        string memory initial
    ) public onlyRole(DEPLOYER_ROLE) {
        addInitial(initial);
        GalNFT nftContract = new GalNFT(
            name,
            symbol,
            fee,
            admin,
            address(this),
            initial
        );
        nftContractAddress.push(nftContract);
        _setupRole(ASSING_ROLE, address(nftContract));

        emit GalileoProtocolDeployed(address(nftContract));
    }

    /**
     * @dev     Method to get NFT Addresses.
     * @return  NFT[]  .
     */

    function getNFTaddress() external view returns (GalNFT[] memory) {
        return nftContractAddress;
    }
}

